import "./PoolFactory.sol";
import "./TeemoPool.sol";
import "../fund/Fund.sol";
import "../risk/Risk.sol";

contract PoolProxy is Ownable {
    address public poolFactoryAddr;

    constructor(
        address _poolFactoryAddr
    ) public {
        poolFactoryAddr = _poolFactoryAddr;
    }

    function setPoolFactoryAddr(address _poolFactoryAddr) public {
        poolFactoryAddr = _poolFactoryAddr;
    }

    function getAllPoolInfo()
        public
        view
        returns (
            address[] memory allTeemoPoolAddr,
            address[] memory allTokenAddr,
            address[] memory allFundAddr,
            address[] memory allRiskAddr,
            address[] memory allSwapTradeAddr,
            address[] memory allMineAddr,
            string[] memory allSymbol,
            uint8[] memory allDecimals
            //,uint256[] memory allBalanceOf
        )
    {
        uint256 poolLength = PoolFactory(poolFactoryAddr).poolLength();

        allTeemoPoolAddr = new address[](poolLength);
        allTokenAddr = new address[](poolLength);
        allFundAddr = new address[](poolLength);
        allRiskAddr = new address[](poolLength);
        allSwapTradeAddr = new address[](poolLength);
        allMineAddr = new address[](poolLength);
        allSymbol = new string[](poolLength);
        allDecimals = new uint8[](poolLength);
        //allBalanceOf = new uint256[](poolLength);

        for (uint256 i = 0; i < poolLength; i++) {
            allTeemoPoolAddr[i] = PoolFactory(poolFactoryAddr).allPoolAddr(i);
            allTokenAddr[i] = TeemoPool(allTeemoPoolAddr[i]).tokenAddr();
            allFundAddr[i] = TeemoPool(allTeemoPoolAddr[i]).fundAddr();
            allRiskAddr[i] = TeemoPool(allTeemoPoolAddr[i]).riskAddr();
            allSwapTradeAddr[i] = TeemoPool(allTeemoPoolAddr[i]).swapTradeAddr();
            allMineAddr[i] = TeemoPool(allTeemoPoolAddr[i]).mineAddr();

            if (allTokenAddr[i] != address(0)) {
                allSymbol[i] = ERC20(allTokenAddr[i]).symbol();
                allDecimals[i] = ERC20(allTokenAddr[i]).decimals();
            } else {
                allDecimals[i] = 18;
            }
            //allBalanceOf[i] = ERC20(allTokenAddr[i]).balanceOf(msg.sender);
        }
    }

    function getAllPositionInfo() public view returns(
        address[] memory allTeemoPoolAddr,
        uint256[] memory allTotalAmount,
        uint256[] memory allTotalSupply,
        uint256[] memory allTotalTokenAmountIn,
        uint256[] memory allTotalTokenAmountOut,
        uint256[] memory allTotalTradeP,
        uint256[] memory allTotalTradeL,
        uint256[] memory allLongOrderTotalAmount,
        uint256[] memory allShortOrderTotalAmount,
        int256[] memory allTotalP,
        int256[] memory allTotalL
    ) {
        uint256 poolLength = PoolFactory(poolFactoryAddr).poolLength();
        allTeemoPoolAddr = new address[](poolLength);
        allTotalAmount = new uint256[](poolLength);
        allTotalSupply = new uint256[](poolLength);
        allTotalTokenAmountIn = new uint256[](poolLength);
        allTotalTokenAmountOut = new uint256[](poolLength);
        allTotalTradeP = new uint256[](poolLength);
        allTotalTradeL = new uint256[](poolLength);
        allLongOrderTotalAmount = new uint256[](poolLength);
        allShortOrderTotalAmount = new uint256[](poolLength);
        allTotalP = new int256[](poolLength);
        allTotalL = new int256[](poolLength);
        for (uint256 i = 0; i < poolLength; i++) {
            allTeemoPoolAddr[i] = PoolFactory(poolFactoryAddr).allPoolAddr(i);
            address fundAddr = TeemoPool(allTeemoPoolAddr[i]).fundAddr();
            allTotalAmount[i] = Fund(fundAddr).totalAmount();
            allTotalSupply[i] = Fund(fundAddr).totalSupply();
            allTotalTokenAmountIn[i] = Fund(fundAddr).totalTokenAmountIn();
            allTotalTokenAmountOut[i] = Fund(fundAddr).totalTokenAmountOut();
            allTotalTradeP[i] = Fund(fundAddr).totalTradeP();
            allTotalTradeL[i] = Fund(fundAddr).totalTradeL();

            address riskAddr = TeemoPool(allTeemoPoolAddr[i]).riskAddr();
            (uint256 longOrderTotalAmount, uint256 shortOrderTotalAmount) = Risk(riskAddr).getTotalOrderTotalAmount();
            allLongOrderTotalAmount[i] = longOrderTotalAmount;
            allShortOrderTotalAmount[i] = shortOrderTotalAmount;
            allTotalP[i] = Risk(riskAddr).getTotalP();
            allTotalL[i] = Risk(riskAddr).getTotalL();
        }
    }

    function getPositionInfo(address teemoPoolAddr) public view returns(
        uint256 totalAmount,
        uint256 totalSupply,
        uint256 totalTokenAmountIn,
        uint256 totalTokenAmountOut,
        uint256 totalTradeP,
        uint256 totalTradeL,
        uint256 longOrderTotalAmount, 
        uint256 shortOrderTotalAmount,
        int256  totalP,
        int256  totalL
    ) {
        address fundAddr = TeemoPool(teemoPoolAddr).fundAddr();
        totalAmount = Fund(fundAddr).totalAmount();
        totalSupply = Fund(fundAddr).totalSupply();
        totalTokenAmountIn = Fund(fundAddr).totalTokenAmountIn();
        totalTokenAmountOut = Fund(fundAddr).totalTokenAmountOut();
        totalTradeP = Fund(fundAddr).totalTradeP();
        totalTradeL = Fund(fundAddr).totalTradeL();

        address riskAddr = TeemoPool(teemoPoolAddr).riskAddr();
        (uint256 longOrderTotalAmount, uint256 shortOrderTotalAmount) = Risk(riskAddr).getTotalOrderTotalAmount();
        totalP = Risk(riskAddr).getTotalP();
        totalL = Risk(riskAddr).getTotalL();
    }

    function poolLength() public view returns(uint256) {
        return PoolFactory(poolFactoryAddr).poolLength();
    }

    // function orderLength(address _teemoPoolAddr, address _userAddress) public view returns (uint256) {
