    function getOrder(address _teemoPoolAddr, bytes32 _orderID)
        public
        view
        returns (
            address userAddr,
            string memory symbol,
            uint256 tokenAmount,
            uint256 lever,
            uint256 bsFlag,
            uint256 openPrice,
            uint256 openTime,
            uint256 pLimitPrice,
            uint256 lLimitPrice,
            uint256 closePrice,
            uint256 closeTime
        )
    {
        address swapTradeAddr = TeemoPool(_teemoPoolAddr).swapTradeAddr();
        (userAddr, symbol, tokenAmount, lever, , , , , , , ) = SwapTrade(swapTradeAddr).allOrderHash(_orderID);
        (, , , , bsFlag, openPrice, openTime, pLimitPrice, , , ) = SwapTrade(swapTradeAddr).allOrderHash(_orderID);
        (, , , , , , , pLimitPrice, lLimitPrice, closePrice, closeTime) = SwapTrade(swapTradeAddr).allOrderHash(_orderID);
    }

    function getLimitOrder(address _teemoPoolAddr, bytes32 _orderID)
        public
        view
        returns (
            address userAddr,
            string memory symbol,
            uint256 tokenAmount,
            uint256 lever,
            uint256 bsFlag,
            uint256 openPrice,
            uint256 openTime,
            uint256 newPrice,
            uint256 pLimitPrice,
            uint256 lLimitPrice,
            uint256 closeTime,
            uint256 status
        ) 
    {
        //address swapTradeAddr = TeemoPool(_teemoPoolAddr).swapTradeAddr();
        //userAddr, symbol, tokenAmount, lever, bsFlag, openPrice, openTime, newPrice, pLimitPrice, lLimitPrice, closeTime, status
